import React from "react";

const Interests = () => {
  return (
      <div class="Interests">
        <h2>Skills</h2>
        <h5>
            Swimming
        </h5>
        <p>
            Member of the Notre Dame Men's Swimming and Diving team.
            NCAA All-American and school 200 Breaststroke record holder.
        </p>
      </div>
  )
}

export default Interests;
